Whilst on the subject of family I’m revisiting and updating an old series I started in 2009 investigating shared familial traits over the generations. The portraits are constructs of two or more faces resulting in an exotic fantasy hybrid. Although looking at the faces separately the similarities may not be immediately apparent, when layered in this way the resemblances are uncanny. An eyebrow, a nose, the set of the chin, a glance appearing from one generation to the next, linking us to the past and reaching out to the future......

